import styled, { keyframes } from 'styled-components';
import Bull from '../../BullOnCliff.PNG';
import Phone from '../../AppPhone.PNG';
import React, { useState, useEffect } from 'react';

// Keyframes for cinematic camera effect
const cinematicCamera = keyframes`
  from {
    perspective-origin: 60% 40%;
  }
  to {
    perspective-origin: 40% 60%;
  }
  from,
  to {
    opacity: 0;
  }
  25%,
  75% {
    opacity: 1;
  }
`;

const imagePop = keyframes`
  70%,
  100% {
    transform: translate3d(0, 0, 60px);
  }
`;

const cinematic = keyframes`
  from {
    transform: translateZ(-200px) rotateY(30deg) translateY(50vh);
  }
  to {
    transform: translateZ(-100px) rotateY(-30deg) translateY(-100%) translateY(50vh);
  }
`;

// Keyframes for fade-in and fade-out effects
const fadeIn = keyframes`
  from {
    opacity: 0;
  }
  to {
    opacity: 1;
  }
`;

const fadeOut = keyframes`
  from {
    opacity: 1;
  }
  to {
    opacity: 0;
  }
`;

// Keyframes for shooting star effect
const shootingStar = keyframes`
  0% {
    opacity: 0;
    transform: translateX(-50px) translateY(-50px) rotate(45deg);
  }
  50% {
    opacity: 1;
    transform: translateX(150px) translateY(150px) rotate(45deg);
  }
  100% {
    opacity: 0;
    transform: translateX(300px) translateY(300px) rotate(45deg);
  }
`;

// Styled-components for both parts of the component
const Container = styled.div`
  perspective: 1200px;
  transform-style: preserve-3d;
  animation: ${cinematicCamera} 11s cubic-bezier(0.6, 0, 0.4, 1) both infinite;

  &:after {
    content: "";
    background: linear-gradient(to bottom, #000, #0000 20%, #0000 80%, #000);
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100vh;
  }
`;

const Main = styled.main`
  background: #111;
  border: solid 1px #222;
  padding: 2rem;
  max-width: 100%;
  width: 960px;
  margin: 0 auto;
  display: grid;
  grid-template-columns: 1fr 1fr;
  grid-gap: 2rem;
  transform-origin: top center;
  transform-style: preserve-3d;
  animation: ${cinematic} 11s cubic-bezier(0.6, 0, 0.4, 1) both infinite;

  > * {
    grid-column: 1 / -1;
  }

  img {
    max-width: 100%;
    display: block;
    transform-style: preserve-3d;
    animation: ${imagePop} 11s cubic-bezier(0.6, 0, 0.4, 1) both infinite;

    &:last-of-type {
      animation-delay: 4s;
    }
  }
`;

const Header = styled.header`
  display: grid;
  align-content: center;
  grid-column: 1 / -1;

  h2.subheader {
    font-size: 2vw;
  }
`;

const Callout = styled.div`
  text-align: center;
  background-color: #3173fa;
  padding: 1vw 3vw;

  > p {
    color: white;
  }
`;

const StyledH1 = styled.h1`
  line-height: 1.3;
  font-size: 5vw;
  margin: 1rem 0;
`;

const StyledH2 = styled.h2`
  font-size: 4vw;
  margin: 1rem 0;
`;

const StyledH3 = styled.h3`
  font-size: 2vw;
  font-weight: bold;
`;

const StyledP = styled.p`
  line-height: 1.8;
  margin: 1rem 0;
  color: rgb(158, 166, 184);
`;

const HomeWrapper1 = styled.div`
  background: hsla(214, 44%, 17%, 1);
  background: linear-gradient(0deg, hsla(214, 44%, 17%, 1) 0%, hsla(216, 39%, 16%, 1) 0%, hsla(214, 40%, 22%, 1) 100%);
  background-size: cover;
  width: 100%;
  height: 200vh;
  position: absolute;
  top: 0;
  animation: ${fadeIn} 2s ease-in-out;

  @media (max-width: 768px) {
    height: 250vh;
  }
`;

const Bullimg = styled.img`
  width: 42%;
  height: auto;
  position: absolute;
  right: 62%;
  top: 16%;

  @media (max-width: 1024px) {
    width: 40%;
    right: 63.5%;
    top: 16%;
  }

  @media (max-width: 768px) {
    width: 60%;
    right: 45.5%;
    top: 10%;
  }

  @media (max-width: 480px) {
    width: 80%;
    right: 5%;
    top: 35%;
  }
`;

const Phoneimg = styled.img`
  width: 40%;
  height: auto;
  position: absolute;
  right: 5%;
  top: 45%;

  @media (max-width: 1024px) {
    width: 40%;
    right: 10%;
    top: 50%;
  }

  @media (max-width: 768px) {
    width: 50%;
    right: -5%;
    top: 40%;
  }

  @media (max-width: 480px) {
    width: 80%;
    right: 5%;
    top: 55%;
  }
`;

const ShootingStar = styled.div`
  width: 2px;
  height: 2px;
  background: white;
  box-shadow: 0 0 8px white, 0 0 10px white, 0 0 15px white, 0 0 25px white;
  position: absolute;
  top: 10%;
  left: 10%;
  animation: ${shootingStar} 2s infinite ease-in-out;
  transform-origin: left top;
`;

export const CombinedHome = () => {
  const [showFirstPart, setShowFirstPart] = useState(true);
  const [fadeOutFirstPart, setFadeOutFirstPart] = useState(false);

  useEffect(() => {
    // Trigger fade-out after 11 seconds (or the duration of the cinematic animation)
    setTimeout(() => {
      setFadeOutFirstPart(true);
      setTimeout(() => {
        setShowFirstPart(false);
      }, 2000); // Match this to the duration of the fadeOut animation
    }, 11000); // Adjust this to the length of your first part animation
  }, []);

  return (
    <div>
      {showFirstPart ? (
        <Container style={{ animation: fadeOutFirstPart ? `${fadeOut} 2s forwards` : 'none' }}>
          <Main>
            <Header>
              <StyledH2 className="subheader">— Keyframers</StyledH2>
              <StyledH1>Where we bring imaginative user interfaces <em>to life.</em></StyledH1>
